	_this.SetToSelectBox(&quot;&quot;,sheet,1,2,&quot;V_TAX_COMPANY&quot;,where);

	cal(0);
	cal(23-6);


}
//计算增长率
function cal(startrow)
{
	var old = 0.0;
	for(var i = 6+startrow;i&lt; 18+startrow;i++){
		var cur = 1.0*_this.GetCellText(0,i,2);
		var last = 1.0*_this.GetCellText(0,i,4);
		if ( _this.GetCellText(0,i,2)==&quot;&quot;||_this.GetCellText(0,i,2)==&quot;0&quot; ) break;
		if ( old!=0 ) {
			var val = (cur-old)/old;
			_this.SetCellText(0,i,3,convertRound(val,2));
		}
		if ( last !=&quot;&quot; && last != &quot;0&quot;)
			_this.SetCellText(0,i,5,convertRound((cur-last)/last,2));

		old= cur;
	}


}

function convertRound(ADoubleInput,ADotNumber){
    var tmpValue1=1;
    var tmpValue2=1;
    if (ADotNumber&lt;0) return ADoubleInput;
    if (0==ADoubleInput) return Math.round(ADoubleInput);
    for (i=0;i&lt;ADotNumber;i++){
      tmpValue1=tmpValue1*10;
    }
    tmpValue2=ADoubleInput*tmpValue1;
    return Math.round(tmpValue2)/tmpValue1;
}

function getxml(startrow)
{
	var xml = &quot;&lt;?xml version = &apos;1.0&apos;?&gt;&lt;ROWSET&gt;&quot;;
	var rw = 0;
	for ( var r =startrow+6;r&lt;=startrow+17;r++ ) {
		xml += &quot;&lt;ROW num=\&quot;&quot;+(rw++)+&quot;\&quot; name=\&quot;&quot;+_this.GetCellText(0,r,1)+&quot;\&quot;&gt;\n&quot;;
		xml += &quot;&lt;本年&gt;&quot;+_this.GetCellText(0,r,2)+&quot;&lt;/本年&gt;\n&quot;;
		xml += &quot;&lt;上年&gt;&quot;+_this.GetCellText(0,r,4)+&quot;&lt;/上年&gt;\n&quot;;
		xml += &quot;&lt;/ROW&gt;\n&quot;;
	}
	xml += &quot;&lt;/ROWSET&gt;&quot;;

	return xml;

}

