ROW.DATDSC:
select mm 月份,sum(elemny)/10000 本月电力,0 a1,sum(lastememny)/10000 上月电力 ,0 a2
from (
select c.id mm,a.elemny,lastememny from (  
  select a.yymm,nvl(sum(elemny),0) elemny,0 lastememny 
  from tax_eledata a,tax_company b,tax_compclass d
  where  a.usrid=b.ammno
  and b.typclsid=d.id
  and nvl(b.typclsid,&apos; &apos;) like &apos;[%HY]%&apos;
  and b.id like &apos;[%QY]%&apos;
  and substr(a.yymm,0,4)= NVL(&apos;[%YYYY]&apos;,to_char(sysdate,&apos;yyyy&apos;))
  group by a.yymm
) a,v_mm c where substr(a.yymm(+),-2)=c.id

union all

select c.id mm,elemny,lastememny  from ( 
  select  a.yymm,0 elemny,nvl(sum(elemny),0) lastememny 
  from tax_eledata a,tax_company b,tax_compclass d
  where a.usrid=b.ammno and b.typclsid=d.id
  and nvl(b.typclsid,&apos; &apos;) like &apos;[%HY]%&apos;
  and b.id like &apos;[%QY]%&apos;
  and to_char(to_number(substr(a.yymm,0,4))+1)=NVL(&apos;[%YYYY]&apos;,to_char(sysdate,&apos;yyyy&apos;))
  group by a.yymm
) a,v_mm c where substr(a.yymm(+),-2)=c.id
)
group by mm
order by mm
